import React from 'react'

function AllUsers({allUsers}) {
  return (
    <div> <table className="productTable">
    <thead>
      <tr>
        <th>Name</th>
        <th>Email</th>
        <th>Membership</th>
        <th>Link</th>
      </tr>
    </thead>
    <tbody>
      {allUsers.map((user) => {
        return (
          <tr key={user._id}>
            <th>{user.name}</th>
            <th>{user.email}</th>
            <th>{user.membership}</th>

            <th>
              <Link>Edit</Link>
            </th>
          </tr>
        );
      })}
    </tbody>
  </table></div>
  )
}

export default AllUsers
